def update_poly(p):
    r = []
    for i, a in enumerate(p):
        r.append(pow(7, i, Q) * a % Q)
    return r

def value(x, p):
    v = 0
    for coeff in p[::-1]:
        v = (v * x + coeff) % Q
    return v

N = len(p1)
assert len(p1) == N
logn = int(math.log(N, 2))
fmt = "0%db" % logn

def bit_rev_str(i):
    r = format(i, fmt)[::-1]
    assert(len(r) == logn)
    return r

def compute_bit_rev(i):
    r = bit_rev_str(i)
    return int(r, base=2)

def find_exp(y, p):
    for i in range(N):
        x = pow(8209, i, Q)
        if value(x, p) % Q == y:
            print(format(i, fmt))
            return i
    assert False

p2 = update_poly(p1)
for i, y in enumerate(ys):
    j = find_exp(y, p2)
    assert compute_bit_rev(j) == i
